      | 47701 -> { ItemTypeData.id= 47701; name= "Gravid Stasis Webifier Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter energy stasis entanglement devices. As such this mutaplasmid could be used to mutate the performance characteristics of most stasis webifiers.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool appears to be mature and reproducing at a healthy rate. The mutational benefits and risks of using this mutaplasmid are within relatively balanced bounds.  "; marketGroupId= Some(2442); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
